import React from "react";
import { useSelector } from "react-redux";
const Cart = () => {
  const mycart = useSelector((state) => state);

  return (
    <div>
      <h2>Shopping Cart</h2>
      {console.log(mycart)}
    </div>
  );
};

export default Cart;
